INSERT INTO `about` VALUES (1,NULL,'{\"ops\":[{\"insert\":\"Hey there!\"},{\"attributes\":{\"header\":1},\"insert\":\"\\n\"},{\"insert\":\"You found me, but this blog is heavily under development!\"},{\"attributes\":{\"header\":3},\"insert\":\"\\n\"},{\"insert\":\"Soooooooooooo if you are encountering any bug or have a suggestion and you would like to connect, you can find my Github on the page footer.\\n\\nThis blog is developing with Angular and Tornado. Its UI is Material UI (what I design is not beautiful, I know). Any technical thing you can also find on the page footer.\\n\\nAbout me\"},{\"attributes\":{\"header\":3},\"insert\":\"\\n\"},{\"insert\":\"I am currently studying Computer Science on University College Dublin.\\nHave 2 years development experience with Angular. Some experience is about ASP.NET Core, Tornado, Python. \\nLike doing something weird, such as using \"},{\"attributes\":{\"color\":\"#222222\"},\"insert\":\"Android accessibility to pay with fingerprint on phone don\'t support Alipay fingerprint. (Because my device is not on Alipay supoort list)\"},{\"insert\":\"\\n\\nIn my undergraduate, I was trying to mock the dialing because the original dialing app only support 1 device to access the Internet, which sucks!\\nBut the app was only working for 1 year, and the algorithm was updated. I also graduated, so the dialing app will no longer update.\\n\\nI also did some crawlers for fun. But the website nowadays is really hard to fetch because of popularity of single page website.\\n\"}]}','2019-10-25 09:26:45','2019-10-25 20:20:40');
