:{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"export class ParentComponent implements OnInit {\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"data: string;\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"constructor() { }\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"ngOnInit() {\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"this.data = \\\"parent\\\";\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"}\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"output($event){\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"console.log($event);\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"}\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"}\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"在上面的例子中，我们在子组件ChildComponent添加了一个向外传播的事件output:EventEmitter<string> = new EventEmitter<string>()，并添加了一个点击的按钮，当按钮事件触发时，就会调用output事件向父组件传递事件，并将数据作为参数传递到父组件ParentComponent中，同时在父组件ParentComponent的模板<child [input]=\\\"data\\\" (output)=\\\"output($event)\\\"></child>中可以看到，我们使用模板语法中的事件绑定，绑定了output函数作为对应事件的接受函数，当子组件output事件触发是，父组件的函数就会得到执行。\\n使用事件传播来进行子组件对父组件之间的通信是最常见的方式。\\n\\n6. 本地变量\"},{\"attributes\":{\"header\":3},\"insert\":\"\\n\"},{\"insert\":\"在模板语法中，我们知道存在着本地变量这种语法，可以使用本地变量来代表对应的组件。虽然父组件不能使用数据绑定来读取子组件的属性或调用子组件的方法。但可以在父组件模板里，新建一个本地变量来代表子组件，然后利用这个变量来读取子组件的属性和调用子组件的方法，不过这种使用方式只能在模板中使用，例如如下所示，改写上面例子中的父组件模板，代码如下。\\n我们在ParentComponent组件中使用本地变量#child获取了child组件的实例，这样就可以在模板中使用其属性或者方法，例如child.input。\\n@Component({\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"selector: \'parent\',\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"template: \'<child [input]=\\\"data\\\" (output)=\\\"output($event)\\\" #child></child>{{child.input}}\'\"},{\"attributes\":{\"code-block\":