sert\":\"《复仇者联盟3：无限战争》是一部创造了英雄电影奇迹的作品，罗素兄弟在150分钟的时间里，将多达76个角色合理的填充到了剧情之中，并给予了反派灭霸充沛的人物塑造，多线叙事的齐头并进繁而不乱，忍俊不禁的幽默点缀彰显着漫威电影的鲜明特性，极为出色的叙事节奏掌控，登峰造极。\"},{\"insert\":\"\\n\\n\"},{\"attributes\":{\"color\":\"#666666\",\"background\":\"transparent\"},\"insert\":\"在历经了《复联2：奥创纪元》的滑铁卢之后，摆在《无限战争》面前最大的问题，其实就是如何将繁多的人物群戏做到面面俱到，而在时间上来看虽然《复联3》有着150分钟的时长，但平摊到每个角色上其实还不到两分钟，电影更还要去填补在前作中那不胜枚举为漫威粉丝所留下的线索。\"},{\"insert\":\"\\n\\n\"},{\"attributes\":{\"color\":\"#666666\",\"background\":\"transparent\"},\"insert\":\"面对困难罗素兄弟对电影的定位上明显要比乔斯·韦登高明不少，《无限战争》很明确的摆出了其就是一部粉丝向的作品，电影几乎每一分钟都在致力于去与漫威宇宙相关联，去更为缜密的透过关联前作剧情去展现漫威宇宙独有的魅力。\"},{\"insert\":\"\\n\\n\"},{\"attributes\":{\"color\":\"#666666\",\"background\":\"transparent\"},\"insert\":\"这份缜密，自然离不开电影对叙事的出色驾驭。在《无限战争》中，电影采用了在漫威电影里颇为罕见的多线叙事手法，数条线索的展开交汇，构建起了一个有条不紊的整体。而不论是矛盾冲突，还是并肩而战，每一个角色又都在这一整体中都有着相对应的发挥，这种完全有别于一带而过的走马观花，确在有限的时间里将不同英雄的人物魅力得以了最大程度的发挥，特别是对于熟识漫威宇宙的粉丝，相信都会在自己钟爱的人物上找到认同感。\"},{\"insert\":\"\\n\\n\"},{\"attributes\":{\"color\":\"#666666\",\"background\":\"transparent\"},\"insert\":\"电影尤为值得一提的是其反派人物的塑造上，《无限战争》的灭霸与《奥创纪元》中的奥创是完全不可同日而语的，这也是《无限战争》给我带来的最大惊喜。其在极为有限的时间里仍旧给予了这一反派人物足够充沛的塑造，从他的野心动机为切入的展开，一个带有悲情色彩的反派得以了呼之欲出。并不夸张的说灭霸俨然就是漫威宇宙电影以来最为生动的反派人物，电影赋予灭霸的孤独痛苦，远比一个只是为了成为最强，去打出令宇宙胆寒响指的反派来的更为真实。\"},{\"insert\":\"\\n\\n\"},{\"attributes\":{\"color\":\"#666666\",\"background\":\"transparent\"},\"insert\":\"作为一部集大成的作品，《无限战争》几乎满足了漫威粉丝的所有需求，但也正是这样，对于并不了解漫威电影，甚至于对并不熟悉漫威宇宙的人来说《无限战争》都算不上是一部友好的电影，这也是即便作为导演的罗素兄弟也不可能以去逆转的一个缺陷，《无限战争》直白的来看其实就是一个复杂的命题作文，罗素兄弟所能做的只是去考虑如何为电影锦上添花。\"},{\"insert\":\"\\n\\n\"},{\"attributes\":{\"color\":\"#666666\",\"background\":\"transparent\"},\"insert\":\"承上启下的《复仇者联盟3：无限战争》完美的完成了自身的使命，漫威十年精华的凝聚，使电影不再是只是一场金玉其外的爆米花，其有着有血有肉的人物，有着能打动人心的悲壮之笔，更令人拭目以待于这一英雄聚合的最终篇章。\"},{\"insert\":\"\\n\"}]}','[\"电影\"]','2018-06-27 05:22:31',1,0,NULL),(35,1,'复仇者联盟3：全灭',NULL,'评分：8.2 / 10分，5/ 5分。\n远在4月25日全球开画之前，迪士尼就已经在日本的官方宣传语中剧透了本片的结局，所以也没什么好遮遮掩掩、防不胜防的了。没错，就是全灭！自从中国上映以来，朋友圈、微','{\"ops\":[{\"insert\":\"评分：8.2 / 10分，5/ 5分。\\n远在4月25日全球开画之前，迪士尼就已经在日本的官方宣传语中剧透了本片的结局，所以也没什么好遮遮掩掩、防不胜防的了。没错，就是全灭！自从中国上映以来，朋友圈、微博哀嚎遍野，迷妹们纷纷打算往漫威总部和导演、编剧家中寄刀片。要我说，你们够了！对于全灭结局无法接受的一定是不怎么看日漫美漫，或者没看过《X战警之逆转未来》电影的。就超级英雄电影来说，这并不是第一次英雄们团灭啊！但这也意味着，下一部《复联4》总会用某种办法让英雄们集体复活，最不济，不还有龙珠么，救了地球无数次。\\n但严格来说，本片中的全灭是随机消灭一半。有没有觉得这个设定似曾相识，如果看过丹布朗的小说《地狱》或者汤姆汉克斯主演的改编电影《但丁密码》，绝对会对其中悲天悯人的反派佐布里斯特的理论记忆犹新。他问道，一百年后人类集体灭绝和现在消除一半人口，人类一百年后不会灭绝，会作何选择，最终他决定随机消灭一半人口以中止人口爆炸带来的生存灾难。不过他的做法仅仅是释放一种无害的瘟疫，让全人类随机绝育。相比来说，具有同样哲学思想的灭霸大爷就要极端与务实的多。灭霸大爷同样目睹了自己星球的人口灾难后，决定维持宇宙的平衡，到处制造大屠杀，消除各个星球半数人口，最后还收集无限原石，一次性消除了全宇宙一半的生命。灭霸完成了佐布里斯特想做却并不真正敢做的事情。\\n网上有能人统计了本片全部主要角色的出场时间，灭霸最多，《复联3》确实也可以称作是《灭霸传》。这个反派拥有九头蛇样的庞大组织，像奥创一样具备崇高的哲学思想，头脑聪明，善于制造大危机，又像天启，个人实力也很强大，对付这样的敌人，没有琴葛蕾的宇宙凤凰之力，猩红女巫又被削去混沌之力，复仇者联盟毫无招架余地。看完这部电影，笔者真心站到了灭霸的一边，也很乐于看到复仇者们团灭的结果。当然，说是团灭，第一阶段的那些英雄一个都没事，消失的全是从第二阶段加入系列的新角色，但真正死透的角色只有卡魔拉和幻视，洛基谁知道真死假死（考虑到他假死的前科太多）。\\n漫威进入第三阶段以后，笔者就感觉到，这个系列的续集已经开始走向粉丝向、影迷向，对于路人越来越不友好，如果没有看过系列前面的作品，对影片的细节和线索的理解必然会大打折扣。而这部《复仇者联盟3》又把这种倾向往前推进了一大步，它直接由漫威十年的全部电影直接推导而出，把所有线索汇总到一起，每一组角色都有所关照。同时电影的叙事节奏飞快，因为人物众多，情节就在不同组人马间来回切换，全然不留铺垫的余地，所有的细节已经在之前的十几部电影中做出了交代，无需赘言。就像《美队3》和《蝙超》在结构和剧情上具有不小的相似性，《复联3》和《正联》更为类似。二者具有一样的结构：英雄相遇、摩擦、组队打怪，反派四处收集道具，节奏也都保持高速运转，不说废话。但《正联》比《复联3》差的是系列电影的铺垫和最终大战。不过也正因为本片高速的节奏与缺乏铺垫和细节交代，不再考虑路人的观影，导致影片门槛提高许多，情节推进有些走马灯，所以笔者有听到许多路人观众发出的差评与不和谐声音。但这不怪他们，系列经营十年，到了该阶段性总结的时候，肯定不能再像《复联1、2》搞一个不怎么相关的事件出来，全速前进才是对一路陪伴的影迷最好的馈赠。\\n对于罗素兄弟执导《复联3》一直都很担心。《美队2》主打动作片和政治惊悚风格，因此罗素兄弟擅长的近身格斗、街头追逐、手持跟拍和摇晃镜头都非常适宜。《美队3》开场的抓捕交叉骨的戏的设计也比较体现兄弟俩的特长，然而机场大战却搞了个摆开对冲，颇像街头火拼，到了结尾美队与铁人的对决，又回到罗素兄弟熟悉的情景。《复联3》中的动作戏大都处理成了小范围的近身战斗，且尽量回避大范围战斗和AOE技能，可谓扬长避短。就连高潮大战，考虑到瓦坎达高度发达的原始战斗方式，以及敌人都是爬行动物，所以设计成古代打仗式的千军万马冲击也并无不可，笔者觉得兄弟俩可以去拍拍魔戒式的战争片。然而就像漫威长久以来对战斗力的弱化，本片也确实只能从听觉上去感受打击感，而无法从视觉上感受到冲击，大概只有顶级战力雷神出手的时候才能感觉到这是超级英雄在战斗。\\n《复联3》保持了罗素兄弟一贯的严肃氛围，然而有逗比护卫队的加入，影片也很难保持不苟言笑。好在这部电影的幽默元素相当克制，不再如《银护2》样刻意搞笑，或者《雷神3》般喧宾夺主，搞笑情节并不多，如同《复联1》里表现的那样，充当影片的调剂，而没有重蹈《雷神3》严重割裂和分化史诗感与严肃情节的覆辙。在灭霸大杀特杀、一路得胜的阴影下，影片呈现出一种盼着英雄受罪、等着他们何时死去的诡异观感，英雄们自己也很难高兴起来，统统表情凝重，电影相当沉重，最后的全灭则有些悲壮与无奈。\\n当然，也不是没有人掉链子，最不安定因素的集大成者彼得奎尔自然不会放过任何一个秀下限的机会，为对抗灭霸之路添加了太多变数，还导致抢夺宝石的过程功亏一篑，无怪乎网络上铺天盖地骂他傻逼的。影片还有些有趣的地方，比如两任福尔摩斯的吵架，三个自大狂聚首，还有来自农业大国瓦坎达的鄙视。\\n既然奇异博士已经预见到了唯一一个战胜灭霸的未来可能性，相信下一部《复联4》就会朝着这个方向发展下去。灭霸不是一个话多的反派，还是漫威十年来塑造最成功的反派，也是战力最强的反派，只希望不要落入漫威一贯的英雄打不过就开挂和削反派的俗套。\\n（更多精彩内容，尽在史歌吹壳子。关注微博：Mosquito史歌，公众号：shige_show）\\n（史歌出品，原创文章，未经授权，不得转载。）\\n文：史歌 \\n2018年5月12日\\n\"},{\"attributes\":{\"color\":\"#333333\",\"background\":\"transparent\"},\"insert\":\" \"},{\"insert\":\"\\n史歌 \"},{\"attributes\":{\"color\":\"#eeeeee\"},\"insert\":\"|\"},{\"insert\":\" 电影爱好者，独立影评人 \"},{\"attributes\":{\"color\":\"#eeeeee\"},\"insert\":\"|\"},{\"insert\":\" 2018-05-12 01:02 \\n\"}]}','[\"电影\"]','2018-06-27 05:22:23',1,0,NULL),(36,1,'复仇者联盟3：十年磨一剑，史诗级巨制',NULL,'经过长达十年的铺垫，漫威电影宇宙迎来了真正的高潮。作为这一出大戏的总舵手，罗素兄弟可谓漫威版的汉武帝，对整个电影宇宙进行了“大一统”，除了鹰眼、蚁人、黄蜂女缺席外，一众超级英雄悉数登场，上演了一次世纪','{\"ops\":[{\"insert\":\"经过长达十年的铺垫，漫威电影宇宙迎来了真正的高潮。作为这一出大戏的总舵手，罗素兄弟可谓漫威版的汉武帝，对整个电影宇宙进行了“大一统”，除了鹰眼、蚁人、黄蜂女缺席外，一众超级英雄悉数登场，上演了一次世纪大同框，却只为了引出漫威史上的最强反派——灭霸。\\n由于“内战事件”，钢铁侠派与美国队长派大打出手，复仇者联盟由此名存实亡。但在大难临头之际，所有超级英雄不得不再次联合起来，阻止灭霸狂悖无道的“生命清除计划”。\\n经过《美国队长3》的“试炼”，罗素兄弟对多线叙事已经轻车熟路，此次竟然动用四条支线，雷神为一支线、钢铁侠等人为一支线、银河护卫队为一支线、美国队长等人为一支线，最后汇合成两条线，开辟出“伏击战”和“守卫战”两个大战场。\\n如此眼花缭乱的设置，稍不留意就可能整段垮掉，但难能可贵的是，罗素兄弟Hold住了这种高难度的编排，节奏流畅，场面宏大，冗而不杂，繁而不乱，每个角色都有存在的意义，连火箭浣熊、格鲁特宝宝、星云、艾崔这样的配角都有用武之地，而不只是走个过场。\\n当然，这一切还得归功于前面十八部大电影的轮番轰炸，观众对钢铁侠、美国队长、雷神、绿巨人、黑寡妇、星爵、奇异博士、黑豹等角色已然耳熟能详，一出场就能勾起回忆，所以根本不需要再多花笔墨去刻画。\\n那么，本片的重心就转移到了本片的大BOSS灭霸身上，不仅戏份碾压任何一个超级英雄，战斗力也是MAX，光凭赤手空拳就能吊打绿巨人，弹指一挥间，半数超级英雄就此灰飞烟灭，一举打破了“反派太弱”的怪圈，俨然成了当仁不让的主角。\\n俗话说：“流氓不可怕，就怕流氓有文化。”如果只有战斗力，灭霸顶多只是莽夫而已，更重要的是，还有着毁灭半个宇宙的“崇高理想”以及深沉的爱。当然，灭霸为了所谓的使命，忍痛放弃了后者，并为之黯然泪下，虽然这情感来得太突然就像一阵风，却使反派突破了“扁平化”的次元壁，一下子变得有血有肉。\\n罗素兄弟显然不想将反派简单地塑造成的“杀人狂魔”，而是塑造了一片灰色地带，也就是为反派找到了一个发人深省的动机：宇宙资源是有限的，只有消灭一半生命，才能维持宇宙平衡！\\n不得不承认，这种似是而非的观点在人类历史上不乏先例，每一次的种族大清洗就是这种思想在作祟。\\n从灭霸屡次对复仇者联盟手下留情就可以看出，两者之间并没有不共戴天的仇恨，只是价值观存在冲突罢了。\\n就像《美国队长3》里所讲叙的一样，美国队长其实与钢铁侠并没有谁对谁错的问题，只是立场不同而已。本片依法炮制了这一点，每个人都为自己的信念而战，并付出了惨重的代价，灭霸牺牲了养女儿、雷神失去洛基、红绯女巫杀死幻视、钢铁侠失去了蜘蛛侠……甚至于，本片还打破了“邪不胜正”的铁律，透着一股仿佛古希腊神话一般的悲壮感，堪称史诗级巨制！\\n\"},{\"attributes\":{\"color\":\"#333333\",\"background\":\"transparent\"},\"insert\":\" \"},{\"insert\":\"\\n樱殇之恋 \"},{\"attributes\":{\"color\":\"#eeeeee\"},\"insert\":\"|\"},{\"insert\":\" 爱生活，爱旅行，爱文学，爱音乐，爱电影，爱自由 \"},{\"attributes\":{\"color\":\"#eeeeee\"},\"insert\":\"|\"},{\"insert\":\" 2018-05-11 23:24 \\n\"}]}','[\"电影\"]','2018-06-27 05:22:17',1,0,NULL),(37,1,'这就是一个博客了',NULL,'这就是一个博客了\n不知不觉中进入计算机行业已有几个年头了，回首往事依然历历在目。今天我把我这几年的学习经历，体会写出来，与大家一起分享，我想其中的一些经历大家也会遇到过，而且会与我产生共鸣，并且我希望','{\"ops\":[{\"attributes\":{\"bold\":true},\"insert\":\"这就是一个博客了\"},{\"attributes\":{\"header\":1},\"insert\":\"\\n\"},{\"insert\":\"不知不觉中进入计算机行业已有几个年头了，回首往事依然历历在目。今天我把我这几年的学习经历，体会写出来，与大家一起分享，我想其中的一些经历大家也会遇到过，而且会与我产生共鸣，并且我希望自己的一些经验与教训能对大家有一定的启发作用。了解别人的经历也许会对自己有一定的帮助作用，那么我的目的也就达到了。\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\\n\"},{\"insert\":\"这篇回忆基本上按照时间顺序来的，我尽量完整，真实的记录下自己所走过的路，其中一些我认为对我产生了比较大的影响的事情我尽量详细说明。回忆从我的大学时代开始吧。\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\\n\"},{\"insert\":\"我本科时读的学校是天津大学，我相信很多北方的学生都会知道这个学校，而很多南方的学生对这个学校了解的并不是很多，但是一提到南开大学，我相信全中国没有人不知道吧。我在那里呆了四年，我发现之所以天津大学的名气这么低主要原因还在于学校的宣传力度不够，让人一听以为是民办大学呢，开个玩笑。其实天大是近代中国的第一所大学，原名北洋大学，学校的实力还是很强的，当时我上的时候网大有一个大学排行榜，当时是排在全国第七，这或多或少能说明了该学校的实力吧。当时我考大学的时候不想离家太近（我家在辽宁），我想出去走走，看看外面的世界，因为从初中到高中，几乎大部分时间都在上学，考试中度过，对外面知之甚少，因此填报志愿的时候我就和我父亲商量，根据我当时的成绩就报了天大，这个决定至今我认为还是很正确的。\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"insert\":\"\\n\"}]}','[\"linux\",\"java\",\"python\",\"电影\",\"html\",\"others\",\"angular\"]','2018-06-27 05:18:13',1,0,NULL),(38,1,'测试','/apis/static/img_article/0c3a2708cd32d7a25168db416350501f.png','测试测试\n\n...','{\"ops\":[{\"insert\":\"测试测试\\n\"},{\"insert\":{\"image\":\"/apis/static/img_article/0c3a2708cd32d7a25168db416350501f.png\"}},{\"insert\":\"\\n\"}]}','[\"电影\"]','2018-09-13 07:24:58',1,0,NULL),(39,1,'Centos Linux python3 安装一条龙命令',NULL,'先上命令，一条一条往会话里输，真的是太墨迹了。想省事的同学请直接复制下面大段命令到控制台执行。\ncd /home \nyum -y install epel-release\nyum groupinsta','{\"ops\":[{\"insert\":\"先上命令，一条一条往会话里输，真的是太墨迹了。想省事的同学请直接复制下面大段命令到控制台执行。\\ncd /home \"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"yum -y install epel-release\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"yum groupinstall -y \\\"Development tools\\\" \"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"yum install -y gcc gcc-c++ gcc-g77 flex bison autoconf automake bzip2-devel zlib-devel ncurses-devel libjpeg-devel libpng-devel libtiff-devel freetype-devel pam-devel openssl-devel libxml2-devel gettext-devel pcre-devel\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"wget https://www.python.org/ftp/python/3.6.6/Python-3.6.6.tgz\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"tar zxvf Python-3.6.6.tgz\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"cd Python-3.6.6\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"./configure prefix=/usr/local/python3\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"make && make install\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"ln -s /usr/local/python3/bin/python3 /usr/bin/python3\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"ln -s /usr/local/python3/bin/pip3 /usr/bin/pip3\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"pip3 install --upgrade pip\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\\n\"},{\"insert\":\"yum install -y chromium \"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"pip3 install selenium\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"实验环境Linux chenos7\\n首先换到工作目录\\ncd /home\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"安装拓展源，有的机房yum仓储东西较少\\nyum -y install epel-release\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"然后安装开发者套件\\nyum groupinstall -y \\\"Development tools\\\"\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"安装剩下的没装上的工具，其实上一个开发者套件应该包含了下面的，但是我安装Python时候说缺zlib-devel之类的，最后网上又找到这条命令\\nyum install -y gcc gcc-c++ gcc-g77 flex bison autoconf automake bzip2-devel zlib-devel ncurses-devel libjpeg-devel libpng-devel libtiff-devel freetype-devel pam-devel openssl-devel libxml2-devel gettext-devel pcre-devel\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"获取python3.6.6\\nwget https://www.python.org/ftp/python/3.6.6/Python-3.6.6.tgz\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"解压\\ntar zxvf Python-3.6.6.tgz\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"换目录并运行配置文件\\ncd Python-3.6.6\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"./configure prefix=/usr/local/python3\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"编译并安装python3\\nmake && make install\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"link连接到bin目录，可以直接使用python3打开python3。linux中自带python2，很多工具例如yum就是通过python命令来执行的，所以我们在这里不能直接python3 到python\\nln -s /usr/local/python3/bin/python3 /usr/bin/python3\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"ln -s /usr/local/python3/bin/pip3 /usr/bin/pip3\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"顺带更新下pip3哈哈哈\\npip3 install --upgrade pip\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"最后两条命令是我自己要用到的环境，所以顺带装上。连接完后就已经可以直接使用python3来打开python了，其余的自己发挥啦\\n\\n\\n\"}]}','[\"linux\",\"python\"]','2018-08-14 06:32:31',1,0,NULL),(40,1,'电信宽带重置密码，两种方法',NULL,'第一种非常简单\n下载10000社区，酷安就有。\n点击我的宽带，然后选择带@ADSL的那条宽带。\n最后重置，重置后密码是123123。\n这种方法不能修改密码，去电信官网修改密码会提示“密码太过于简单”。','{\"ops\":[{\"insert\":\"第一种非常简单\"},{\"attributes\":{\"header\":1},\"insert\":\"\\n\"},{\"insert\":\"下载10000社区，酷安就有。\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"点击我的宽带，然后选择带@ADSL的那条宽带。\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"最后重置，重置后密码是123123。\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"这种方法不能修改密码，去电信官网修改密码会提示“密码太过于简单”。\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":{\"image\":\"/apis/static/img_article/0c6bd0e94e739e08424a7bd697ad73cb.png\"}},{\"insert\":\"\\n\"},{\"insert\":{\"image\":\"/apis/static/img_article/a47b6be8df5f85ab77c6ba08d6117c0c.png\"}},{\"insert\":\"\\n第二种上电信官网重置密码与修改密码\"},{\"attributes\":{\"header\":1},\"insert\":\"\\n\"},{\"insert\":\"微信扫码绑定宽带，地址\"},{\"attributes\":{\"link\":\"http://hb.189.cn/pages/selfservice/custinfomanager/password/resetpassword.jsp\"},\"insert\":\"http://hb.189.cn/pages/selfservice/custinfomanager/password/resetpassword.jsp\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"绑定宽带后，就可以重置密码\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"修改密码可在\"},{\"attributes\":{\"link\":\"http://hb.189.cn/pages/selfservice/custinfomanager/password/password.jsp\"},\"insert\":\"http://hb.189.cn/pages/selfservice/custinfomanager/password/password.jsp\"},{\"insert\":\"里面进行修改，123123密码会提示过于简单无法修改，所以要先重置\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":{\"image\":\"/apis/static/img_article/6ba53d2b77e62e7a08ab89b9f86e017a.png\"}},{\"insert\":\"\\n\"},{\"insert\":{\"image\":\"/apis/static/img_article/c221de0d422451d9b144d8bb4e47a7b8.png\"}},{\"insert\":\"\\n但是这个方法似乎有点小问题，我之前可以，现在不行了，有概率弹出以下这个页面\\n\"},{\"insert\":{\"image\":\"/apis/static/img_article/e465dd2e6f9612a9c4690bd2233e7ad9.jpg\"}},{\"insert\":\"\\n最后一种办法直接10000人工服务\"},{\"attributes\":{\"header\":1},\"insert\":\"\\n\"},{\"insert\":\"这是最最最稳的办法，如果以上方法都不成功。123又觉得太简单，想改密码直接人工服务或者去电信营业厅（记得带上身份证）。\\n\"}]}','[\"others\"]','2018-09-08 16:51:18',1,0,NULL),(41,1,'css position: sticky不生效，你需要注意这个属性的超级大坑',NULL,'.quill-editor > .ql-toolbar {\n  position: sticky;\n  top: 0px;\n}\n你以为就这几句话就可以实现sticky效果吗？\n在普通测试环境当然可以。','{\"ops\":[{\"insert\":\".quill-editor > .ql-toolbar {\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"  position: sticky;\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"  top: 0px;\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"}\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"你以为就这几句话就可以实现sticky效果吗？\\n在普通测试环境当然可以。生产环境要复杂的多，超多的组件，各种各样的布局，导致属性不生效。\\n这里解释了使用这个属性的几个注意事项\"},{\"attributes\":{\"link\":\"https://blog.cloud66.com/position-sticky-problem/\"},\"insert\":\"https://blog.cloud66.com/position-sticky-problem/\"},{\"insert\":\"\\n简单来说就是注意以下几点：\\n\\t\"},{\"attributes\":{\"size\":\"large\"},\"insert\":\"1.\\t首先所有父组件不能包含overflow的几个属性\"},{\"insert\":\"\\noverflow: hidden\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"overflow: scroll \"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"overflow: auto\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"\\t\\t这三个属性，只要父组件有这三个属性或类似属性就会影响position:sticky\\n\\t\"},{\"attributes\":{\"size\":\"large\"},\"insert\":\"2.\\t父组件不能包含任何相对的height\"},{\"insert\":\"\\n.wrap {\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"  margin: 0 auto;\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"  width: 90%;\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"  height: 40%; \"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"}\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"我的博客编辑器的父组件用了overflow:auto导致工具栏无法sticky。\\n最后上个效果图：\\n\"},{\"insert\":{\"image\":\"/apis/static/img_article/0c3a2708cd32d7a25168db416350501f.png\"}},{\"insert\":\"\\n工具栏是透明了，可以看到工具栏在编辑栏上方，滑动条也不在顶部。\\n\"}]}','[\"html\"]','2018-09-13 04:37:08',1,0,NULL),(42,1,'1',NULL,'1\n...','{\"ops\":[{\"insert\":\"1\\n\"}]}','[\"linux\"]','2018-11-19 07:24:16',0,0,NULL),(43,1,'加入padding导致元素大小超出父元素',NULL,'解决方案\n给元素设置：\nbox-sizing: border-box;\n问题解决。\n\n解释\n元素默认值为：\nbox-sizing: content-box; \n意思是以content作为盒子计算，而b...','{\"ops\":[{\"insert\":\"解决方案\"},{\"attributes\":{\"header\":1},\"insert\":\"\\n\"},{\"insert\":\"给元素设置：\\nbox-sizing: border-box;\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"问题解决。\\n\\n解释\"},{\"attributes\":{\"header\":1},\"insert\":\"\\n\"},{\"insert\":\"元素默认值为：\\nbox-sizing: content-box; \"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"意思是以content作为盒子计算，而border-box则是以border+padding+content来计算。说白了加了box-sizing: border-box;这个属性后，width=content+padding+border，原来是width=content\\n\\n请参考：\\n\"},{\"attributes\":{\"link\":\"https://developer.mozilla.org/zh-CN/docs/Web/CSS/box-sizing\"},\"insert\":\"https://developer.mozilla.org/zh-CN/docs/Web/CSS/box-sizing\"},{\"insert\":\"\\n\\n\"}]}','[\"html\"]','2018-11-19 07:24:51',1,0,NULL),(44,1,'如何使用EntityFrameworkCore自动生成Mysql数据库','/apis/static/img_article/be521aaf7ccba9b701e042e7c45caab5.png','详情参考：https://www.entityframeworktutorial.net/efcore/entity-framework-core-dbcontext.aspx\n使用VS的包管理器控制...','{\"ops\":[{\"insert\":\"详情参考：\"},{\"attributes\":{\"link\":\"https://www.entityframeworktutorial.net/efcore/entity-framework-core-dbcontext.aspx\"},\"insert\":\"https://www.entityframeworktutorial.net/efcore/entity-framework-core-dbcontext.aspx\"},{\"insert\":\"\\n使用VS的包管理器控制台\\n添加新的migration\\nadd-migration YourMirgrationtititi\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"更新数据库\\nupdate-database -verbose\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":{\"image\":\"/apis/static/img_article/be521aaf7ccba9b701e042e7c45caab5.png\"}},{\"insert\":\"\\n\\n\"}]}','[\"EntityFrameworkCore\"]','2018-11-23 09:22:25',1,0,NULL),(45,1,'Angular路由事件及过滤',NULL,'如何在Angular的路由变更的时候做一些事情？例如更改数据，根据路由来变化状态等。\n首先我们先监听路由事件，监听器记得要在constructor()构造函数里面进行注册。因为路由事件触发比较早，第一...','{\"ops\":[{\"insert\":\"如何在Angular的路由变更的时候做一些事情？例如更改数据，根据路由来变化状态等。\\n首先我们先监听路由事件，监听器记得要在constructor()构造函数里面进行注册。因为路由事件触发比较早，第一次路由事件无法在ngOnInit中触发，故写在构造函数里。\\nconstructor(\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"  private router: Router,\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"  private route: ActivatedRoute\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\") {\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"  this.subscriptionRouter = this.router.events.pipe(\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"    filter((event: any) => event instanceof NavigationEnd),\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"    map((route: ActivatedRoute) => {\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"      console.log(route);\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"    })\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"  ).subscribe(() => console.log(this.route.data));\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"}\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"使用完后记得销毁，要不然会一直监听（虽然没什么影响，但是我们要养成良好的释放资源习惯）\\n在ngOnDestory()里面销毁就行了。\\nngOnDestroy() {\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"  this.subscriptionRouter.unsubscribe();\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"}\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"}]}','[\"angular\"]','2018-12-11 13:46:12',1,0,NULL),(46,1,'Angular如何判断组件初始化结束',NULL,'constructor(\n  private appRef: ApplicationRef\n) { }\n\nngOnInit() {\n  // this.isImgLoaded = true;\n  //...','{\"ops\":[{\"insert\":\"constructor(\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"  private appRef: ApplicationRef\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\") { }\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\\n\"},{\"insert\":\"ngOnInit() {\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"  // this.isImgLoaded = true;\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"  // 比较愚蠢的解决方案\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"  // setTimeout(() => this.isImgLoaded = true);\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"  this.appRef.isStable.subscribe((isStable) => {\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"    if (isStable) {\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"      this.isImgLoaded = true;\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"    }\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"  });\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"}\"},{\"attributes\":{\"code-block\":true},\"insert\":\"\\n\"},{\"insert\":\"ApplicationRef里面有一个观察者对象\"},{\"attributes\":{\"bold\":true},\"insert\":\"isStable\"},{\"insert\":\"，返回一个boolean，如果应用稳定后，会返回true。所有有很多需要dom加载完成后的操作可以在订阅isStable来完成。例如获取图像的高度，根据图像的高度来设定合适的css值。可以避免ExpressionChangedAfterItHasBeenCheckedError，这个错误即变更检测错误。\\n\"}]}','[\"angular\"]','2019-03-13 11:21:16',1,0,NULL);
